window.bookSummaryJSON = "<p>Everyone has skeletons in their closet, but Rain's are learning to open the door.</p> <p>Rain's lost everything in the last decade. Her grandmother, her brother, and her family home might be next. All she has is Graham - a powerful Fae who illegally escaped the Fae Realm and has been her best friend ever since.</p> <p>Until Ezra - the sexiest Vampire she's ever seen - commissions her for one hell of a job. Cleansing dozens of vengeful spirits from an abandoned mansion for a life changing amount of money.</p> <p>All Rain wants is to focus on her budding relationship with Ezra, but the ghosts in the mansion have awoken the ones Rain has spent a decade trying to keep locked up.</p> <p>But Rain isn't the only one with secrets. Ezra has a few of his own.</p> <p>In \"Raven's Cry,\" passions ignite and hidden truths unravel in a world where supernatural beings struggle to coexist with the modern world. This paranormal romance is full of unexpected twists, compelling characters, and a story that will leave you craving more. Dive into Rain's journey and discover the secrets that lie in the shadows.</p>"; 
